import React, { useState } from "react";

function MyCourses() {
  const [term01, setCourses] = useState([
    { cName: "Project Management 1", cCode: "Pr111", id: 1 },
    { cName: "C++ Programming Fundamentals", cCode: "C++111", id: 2 },
    { cName: "Computer Maintenance", cCode: "C++111", id: 3 },
    { cName: "Information Security 1", cCode: "C++111", id: 4 },
  ]);

  return (
    <div>
      <h1>My Courses</h1>
    </div>
  );
}

export default MyCourses;
